const Index1 = () => {
  const [message, setMessage] = useState({
    text: "",
    count: 0,
  });
  const handleSubmit = (e) => {
    e.preventDefault();
  };
  return (
    <>
      <form>
        <input
          type="text"
          value={text}
          onChange={(e) =>
            setMessage({
              ...message,
              text: e.target.value,
              count: count + 1,
            })
          }
        />
        <button onSubmit={handleSubmit}>submit</button>
      </form>
      <h1>{text}</h1>
      <h1>{count}</h1>
    </>
  );
};
